import React from "react";

function Main() {
    const [items, setItems] = React.useState([]);

    React.useEffect(() => {
        fetch('https://localhost:7073/User/OneUserGet?id=6')
        .then((res) => res.json())
        .then((arr) => {
            setItems(arr)
        });
    }, []);
   
    
    return(
        <main>
            <p>{items.name}</p>
            <p>{items.lastName}</p>
            <p>{items.patronymic}</p>
        </main>
    )
}

export default Main;
